jssearch.files = {"1":{"u":".\/\/guide-start-databases.html","t":"Trabajar con Bases de Datos ","d":"En esta secci\u00f3n, explicaremos c\u00f3mo crear una nueva p\u00e1gina para mostrar datos de pa\u00edses tra\u00eddos de una tabla de la\nbase de datos llamada country. Para lograr este objetivo, configurar\u00e1s una conexi\u00f3n a la base de datos,\ncrear\u00e1s una clase Active Record, una acci\u00f3n\ny una vista."},"2":{"u":".\/\/guide-start-installation.html","t":"Instalar Yii ","d":"Puedes instalar Yii de dos maneras, utilizando el administrador de paquetes Composer o descargando un archivo comprimido.\nLa forma recomendada es la primera, ya que te permite instalar nuevas extensions o actualizar Yii con s\u00f3lo ejecutar un comando."},"3":{"u":".\/\/guide-tutorial-i18n.html","t":"Internationalization ","d":"Internationalization (I18N) refers to the process of designing a software application so that it can be adapted to\nvarious languages and regions without engineering changes. For Web applications, this is of particular importance\nbecause the potential users may be worldwide. Yii offers a full spectrum of I18N features that support message\ntranslation, view translation, date and number formatting."},"4":{"u":".\/\/guide-test-environment-setup.html","t":"Preparaci\u00f3n del entorno de test ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"5":{"u":".\/\/guide-input-validation.html","t":"Validaci\u00f3n de Entrada ","d":"Como regla b\u00e1sica, nunca debes confiar en los datos recibidos de un usuario final y deber\u00edas validarlo siempre\nantes de ponerlo en uso."},"6":{"u":".\/\/guide-security-authentication.html","t":"Authentication ","d":"Authentication is the process of verifying the identity of a user. It usually uses an identifier\n(e.g. a username or an email address) and a secret token (e.g. a password or an access token) to judge\nif the user is the one whom he claims as. Authentication is the basis of the login feature."},"7":{"u":".\/\/guide-input-forms.html","t":"Creating Forms ","d":"The primary way of using forms in Yii is through yii\\widgets\\ActiveForm. This approach should be preferred when\nthe form is based upon a model. Additionally, there are some useful methods in yii\\helpers\\Html that are typically\nused for adding buttons and help text to any form."},"8":{"u":".\/\/guide-intro-yii.html","t":"\u00bfQu\u00e9 es Yii? ","d":"Yii es un framework de PHP de alto rendimiento, basado en componentes para desarrollar aplicaciones web\nmodernas en poco tiempo. El nombre Yii significa \"simple y evolutivo\" en chino. Tambi\u00e9n se puede considerar como un acr\u00f3nimo\nde Yes It Is (que en ingl\u00e9s significa S\u00ed, eso es)!"},"9":{"u":".\/\/guide-rest-response-formatting.html","t":"Formato de Respuesta ","d":"Cuando se maneja una petici\u00f3n al API RESTful, una aplicaci\u00f3n realiza usualmente los siguientes pasos que est\u00e1n relacionados\ncon el formato de la respuesta:"},"10":{"u":".\/\/guide-README.html","t":"Gu\u00eda Definitiva de Yii 2.0 ","d":"Este tutorial se publica bajo los T\u00e9rminos de Documentaci\u00f3n Yii."},"11":{"u":".\/\/guide-concept-behaviors.html","t":"Comportamientos ","d":"Comportamientos son instancias de yii\\base\\Behavior o sus clases \"hija\". Comportamientos, tambi\u00e9n conocido como\nmixins, te permiten mejorar la funcionalidad de un yii\\base\\Component\nexistente sin necesidad de modificar su herencia de clases.\nCuando un comportamiento se une a un componente, \"inyectar\u00e1\" sus m\u00e9todos y propiedades dentro del componente, y podr\u00e1s\nacceder a esos m\u00e9todos y propiedades como si hubieran estado definidos por la clase de componente. Adem\u00e1s, un\ncomportamiento puede responder a eventos disparados por el componente de modo que se pueda personalizar\no adaptar a la ejecuci\u00f3n normal del c\u00f3digo del componente."},"12":{"u":".\/\/guide-output-client-scripts.html","t":"Trabajar con Scripts del Cliente ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"13":{"u":".\/\/guide-caching-data.html","t":"Almacenamiento de Datos en Cach\u00e9 ","d":"El almacenamiento de datos en cach\u00e9 trata del almacenamiento de alguna variable PHP en cach\u00e9 y recuperarla m\u00e1s tarde del mismo. Tambi\u00e9n es la base de algunas de las caracter\u00edsticas avanzadas de almacenamiento en cach\u00e9, tales como el almacenamiento en cach\u00e9 de consultas a la base de datos y el almacenamiento en cach\u00e9 de contenido."},"14":{"u":".\/\/guide-rest-controllers.html","t":"Controladores ","d":"Despu\u00e9s de crear las clases de recursos y especificar c\u00f3mo debe ser el formato de datos de recursos, el siguiente paso\nes crear acciones del controlador para exponer los recursos a los usuarios finales a trav\u00e9s de las APIs RESTful."},"15":{"u":".\/\/guide-runtime-responses.html","t":"Respuestas ","d":"Cuando una aplicaci\u00f3n finaliza la gesti\u00f3n de una petici\u00f3n (request), genera un objeto \nyii\\web\\Response y lo env\u00eda al usuario final. El objeto response contiene informaci\u00f3n tal como el c\u00f3digo \nde estado (status code) HTTP, las cabeceras (headers) HTTP y el cuerpo (body). El objetivo final del desarrollo de una \naplicaci\u00f3n Web es esencialmente construir objetos response para varias peticiones."},"16":{"u":".\/\/guide-concept-components.html","t":"Componentes ","d":"Los componentes son los principales bloques de construcci\u00f3n de las aplicaciones Yii. Los componentes son instancias de yii\\base\\Component o de una clase extendida. Las tres caracter\u00edsticas principales que los componentes proporcionan\na las otras clases son:"},"17":{"u":".\/\/guide-intro-upgrade-from-v1.html","t":"Actualizar desde Yii 1.1 ","d":"Existen muchas diferencias entre las versiones 1.1 y 2.0 de Yii ya que el framework fue completamente reescrito\nen su segunda versi\u00f3n.\nComo resultado, actualizar desde la versi\u00f3n 1.1 no es tan trivial como actualizar entre versiones menores. En esta\ngu\u00eda encontrar\u00e1s las diferencias m\u00e1s grandes entre estas dos versiones."},"18":{"u":".\/\/guide-db-active-record.html","t":"Active Record ","d":"Active Record provides an object-oriented interface\nfor accessing and manipulating data stored in databases. An Active Record class is associated with a database table,\nan Active Record instance corresponds to a row of that table, and an attribute of an Active Record\ninstance represents the value of a particular column in that row. Instead of writing raw SQL statements,\nyou would access Active Record attributes and call Active Record methods to access and manipulate the data stored \nin database tables."},"19":{"u":".\/\/guide-concept-autoloading.html","t":"Autocarga de clases ","d":"Yii depende del mecanismo de autocarga de clases para localizar\ne incluir los archivos de las clases requiridas. Proporciona un cargador de clases de alto rendimiento que cumple con el\nestandard PSR-4.\nEl cargador se instala cuando incluyes el archivo Yii.php."},"20":{"u":".\/\/guide-db-migrations.html","t":"Migraci\u00f3n de Base de Datos ","d":"Durante el curso de desarrollo y mantenimiento de una aplicaci\u00f3n con base de datos, la estructura de dicha base de datos\nevoluciona tanto como el c\u00f3digo fuente. Por ejemplo, durante el desarrollo de una aplicaci\u00f3n,\nuna nueva tabla podr\u00eda ser necesaria; una vez que la aplicaci\u00f3n se encuentra en producci\u00f3n, podr\u00eda descrubrirse\nque deber\u00eda crearse un \u00edndice para mejorar el tiempo de ejecuci\u00f3n de una consulta; y as\u00ed sucesivamente. Debido a los cambios en la estructura de la base de datos\na menudo se requieren cambios en el c\u00f3digo, Yii soporta la caracter\u00edstica llamada migraci\u00f3n de base de datos, la cual permite\ntener un seguimiento de esos cambios en t\u00e9rmino de migraci\u00f3n de base de datos, cuyo versionado es controlado\njunto al del c\u00f3digo fuente."},"21":{"u":".\/\/guide-runtime-sessions-cookies.html","t":"Sesiones (Sessions) y Cookies ","d":"Las sesiones y las cookies permiten la persistencia de datos a trav\u00e9s de m\u00faltiples peticiones de usuario. En PHP plano, debes acceder a ellos a trav\u00e9s de las variables globales $_SESSION y $_COOKIE, respectivamente. Yii encapsula las sesiones y las cookies como objetos y por lo tanto te permite acceder a ellos de manera orientada a objetos con estupendas mejoras adicionales."},"22":{"u":".\/\/guide-tutorial-yii-integration.html","t":"Trabajar con c\u00f3digo de terceros ","d":"De tiempo en tiempo, puede necesitar usar alg\u00fan c\u00f3digo de terceros en sus aplicaciones Yii. O puedes querer\nutilizar Yii como una librer\u00eda en otros sistemas de terceros. En esta secci\u00f3n, te ense\u00f1aremos c\u00f3mo conseguir estos objetivos."},"23":{"u":".\/\/guide-output-pagination.html","t":"Paginaci\u00f3n ","d":"Cuando hay muchos datos a mostrar en una sola p\u00e1gina, una estrategia com\u00fan es mostrarlos en varias\np\u00e1ginas y en cada una de ellas mostrar s\u00f3lo una peque\u00f1a porci\u00f3n de datos. Esta estrategia es conocida como paginaci\u00f3n."},"24":{"u":".\/\/guide-rest-authentication.html","t":"Autenticaci\u00f3n ","d":"A diferencia de las aplicaciones Web, las API RESTful son usualmente sin estado (stateless), lo que permite que las sesiones o las cookies\nno sean usadas. Por lo tanto, cada petici\u00f3n debe llevar alguna suerte de credenciales de autenticaci\u00f3n,\nporque la autenticaci\u00f3n del usuario no puede ser mantenida por las sesiones o las cookies. Una pr\u00e1ctica com\u00fan\nes enviar una pieza (token) secreta de acceso con cada petici\u00f3n para autenticar al usuario. Dado que una pieza de autenticaci\u00f3n\npuede ser usada para identificar y autenticar solamente a un usuario, la API de peticiones tiene que ser siempre enviado\nv\u00eda HTTPS para prevenir ataques tipo \"man-in-the-middle\" (MitM) ."},"25":{"u":".\/\/guide-input-file-upload.html","t":"Subir Archivos ","d":"Subir archivos en Yii es normalmente realizado con la ayuda de yii\\web\\UploadedFile, que encapsula cada archivo subido\nen un objeto UploadedFile. Combinado con yii\\widgets\\ActiveForm y modelos,\npuedes f\u00e1cilmente implementar un mecanismo seguro de subida de archivos."},"26":{"u":".\/\/guide-tutorial-core-validators.html","t":"Validadores del framework ","d":"Yii provee en su n\u00facleo un conjunto de validadores de uso com\u00fan, que se pueden encontrar principalmente bajo el espacio de nombres (namespace) yii\\validators.\nEn vez de utilizar interminables nombres de clases para los validadores, puedes usar alias para especificar el uso de esos validadores del n\u00facleo. Por ejemplo, puedes usar el alias required para referirte a la clase yii\\validators\\RequiredValidator :"},"27":{"u":".\/\/guide-security-authorization.html","t":"Autorizaci\u00f3n ","d":"Autorizaci\u00f3n esl el proceso de verificaci\u00f3n de que un usuario tenga sugifientes permisos para realizar algo. Yii provee\ndos m\u00e9todos de autorizaci\u00f3n: Filtro de Control de Acceso y Control Basado en Roles (ACF y RBAC por sus siglas en ingl\u00e9s)."},"28":{"u":".\/\/guide-security-cryptography.html","t":"Cryptography ","d":"In this section we'll review the following security aspects:"},"29":{"u":".\/\/guide-rest-error-handling.html","t":"Manejo de errores ","d":"Cuando se maneja una petici\u00f3n de API RESTful, si ocurre un error en la petici\u00f3n del usuario o si algo inesperado\nocurre en el servidor, simplemente puedes lanzar una excepci\u00f3n para notificar al usuario que algo err\u00f3neo ocurri\u00f3.\nSi puedes identificar la causa del error (p.e., el recurso solicitado no existe), debes considerar lanzar una excepci\u00f3n\ncon el c\u00f3digo HTTP de estado apropiado (p.e., yii\\web\\NotFoundHttpException representa un c\u00f3digo de estado 404).\nYii enviar\u00e1 la respuesta a continuaci\u00f3n con el correspondiente c\u00f3digo de estado HTTP y el texto. Yii puede incluir tambi\u00e9n\nla representaci\u00f3n serializada de la excepci\u00f3n en el cuerpo de la respuesta.\nPor ejemplo:"},"30":{"u":".\/\/guide-structure-entry-scripts.html","t":"Scripts de Entrada ","d":"Los scripts de entrada son el primer eslab\u00f3n en el proceso de arranque de la aplicaci\u00f3n. Una aplicaci\u00f3n (ya sea una \naplicaci\u00f3n Web o una aplicaci\u00f3n de consola) tiene un \u00fanico script de entrada. Los usuarios finales hacen peticiones al \nscript de entrada que instancia instancias de aplicaci\u00f3n y remite la petici\u00f3n a estos."},"31":{"u":".\/\/guide-runtime-overview.html","t":"Informaci\u00f3n General ","d":"Cada vez que una aplicaci\u00f3n Yii gestiona una petici\u00f3n, se somete a un flujo de trabajo similar."},"32":{"u":".\/\/guide-start-hello.html","t":"Diciendo Hola ","d":"Esta secci\u00f3n describe c\u00f3mo crear la t\u00edpica p\u00e1gina \"Hola Mundo\" (Hello World en ingl\u00e9s) en tu aplicaci\u00f3n.\nPara lograr este objetivo, vas a crear una acci\u00f3n y \nuna vista:"},"33":{"u":".\/\/guide-start-looking-ahead.html","t":"Mirando Hacia Adelante ","d":"Si has le\u00eddo el cap\u00edtulo \"Comenzando con Yii\" completo, has creado una aplicaci\u00f3n completa en Yii. En el proceso, has aprendido c\u00f3mo implementar algunas\ncaracter\u00edsticas com\u00fanmente necesitadas, tales como obtener datos del usuario a trav\u00e9s de formularios HTML, traer datos desde la base de datos,\ny mostrar datos utilizando paginaci\u00f3n. Tambi\u00e9n has aprendido a utilizar Gii para generar\nc\u00f3digo autom\u00e1ticamente. Utilizar Gii para la generaci\u00f3n de c\u00f3digo transforma la carga en el proceso de tu desarrollo Web en una tarea tan simple como solamente completar unos formularios. "},"34":{"u":".\/\/guide-structure-views.html","t":"Vistas ","d":"Las Vistas (views) son una parte de la arquitectura MVC.\nEstas son el c\u00f3digo responsable de presentar los datos al usuario final. En una aplicaci\u00f3n Web, las vistas son usualmente creadas\nen t\u00e9rminos de templates que son archivos PHP que contienen principalmente HTML y PHP.\nEstas son manejadas por el componente de la aplicaci\u00f3n yii\\web\\View, el cual provee los m\u00e9todos com\u00fanmente utilizados\npara facilitar la composici\u00f3n y renderizado. Por simplicidad, a menudo nos referimos a los templates de vistas o archivos de templates\ncomo vistas."},"35":{"u":".\/\/guide-test-acceptance.html","t":"Acceptance Tests ","d":"Note: This section is under development."},"36":{"u":".\/\/guide-tutorial-shared-hosting.html","t":"Shared Hosting Environment ","d":"Shared hosting environments are often quite limited about configuration and directory structure. Still in most cases you\ncan run Yii 2.0 on a shared hosting environment with a few adjustments."},"37":{"u":".\/\/guide-rest-routing.html","t":"Enrutamiento ","d":"Con las clases de controlador y recurso preparadas, puedes acceder a los recursos usando una URL como\nhttp:\/\/localhost\/index.php?r=user\/create, parecida a la que usas con aplicaciones Web normales."},"38":{"u":".\/\/guide-structure-assets.html","t":"Assets ","d":"Un asset en Yii es un archivo al que se puede hacer referencia en una p\u00e1gina Web. Puede ser un archivo CSS, un archivo\nJavaScript, una imagen o un archivo de video, etc. Los assets se encuentran en los directorios p\u00fablicos de la web y se\nsirven directamente por los servidores Web."},"39":{"u":".\/\/guide-runtime-requests.html","t":"Peticiones ","d":"Las peticiones (requests) hechas a una aplicaci\u00f3n son representadas como objetos yii\\web\\Request que proporcionan \ninformaci\u00f3n como par\u00e1metros de la petici\u00f3n, cabeceras HTTP, cookies, etc. Dada una petici\u00f3n, se puede acceder al \nobjeto request correspondiente a trav\u00e9s del componente de aplicaci\u00f3n request \nque, por defecto, es una instancia de yii\\web\\Request. En esta secci\u00f3n se describir\u00e1 como hacer uso de este \ncomponente en las aplicaciones."},"40":{"u":".\/\/guide-concept-service-locator.html","t":"Localizador de Servicios ","d":"Un localizador de servicios es un objeto que sabe c\u00f3mo proporcionar todo tipo de servicios (o componentes) que puede necesitar una aplicaci\u00f3n. Dentro de un localizador de servicios, existe en cada componente como una \u00fanica instancia, \u00fanicamente identificado por un ID. Se utiliza el ID para recuperar un componente desde el localizador de servicios."},"41":{"u":".\/\/guide-test-fixtures.html","t":"Fixtures ","d":"Los fixtures son una parte importante de los tests. Su prop\u00f3sito principal es el de preparar el entorno en una estado fijado\/conocido\nde manera que los tests sean repetibles y corran de la manera esperada. Yii provee un framework de fixtures que te permite\ndichos fixtures de manera precisa y usarlo de forma simple."},"42":{"u":".\/\/guide-structure-controllers.html","t":"Controladores ","d":"Los controladores son parte del patr\u00f3n o arquitectura MVC.\nSon objetos que extienden de yii\\base\\Controller y se encargan de procesar los requests (consultas)\ngenerando responses (respuestas). Particularmente, despu\u00e9s de tomar el control desde las aplicaciones,\nlos controladores analizar\u00e1n los datos que entran en el request, los pasan a los modelos, inyectan los\nmodelos resultantes a las vistas, y finalmente generan los responses (respuestas) de salida."},"43":{"u":".\/\/guide-rest-quick-start.html","t":"Gu\u00eda Breve ","d":"Yii ofrece todo un conjunto de herramientas para simplificar la tarea de implementar un\nservicio web APIs RESTful.\nEn particular, Yii soporta las siguientes caracter\u00edsticas sobre APIs RESTful;"},"44":{"u":".\/\/guide-test-overview.html","t":"Testing ","d":"Testing is an important part of software development. Whether we are aware of it or not, we conduct testing continuously.\nFor example, when we write a class in PHP, we may debug it step by step or simply use echo or die statements to verify\nthe implementation works according to our initial plan. In the case of a web application, we're entering some test data\nin forms to ensure the page interacts with us as expected."},"45":{"u":".\/\/guide-tutorial-template-engines.html","t":"Usar motores de plantillas ","d":"Por defecto, Yii utiliza PHP como su lenguaje de plantilla, pero puedes configurar Yii para que soporte otros motores de renderizado, tal como\nTwig o Smarty, disponibles como extensiones."},"46":{"u":".\/\/guide-rest-rate-limiting.html","t":"Limitando el rango (rate) ","d":"Para prevenir el abuso, puedes considerar a\u00f1adir un l\u00edmitaci\u00f3n del rango (rate limiting) para tus APIs. Por ejemplo,\npuedes querer limitar el uso del API de cada usuario a un m\u00e1ximo de 100 llamadas al API dentro de un periodo de 10 minutos.\nSi se reciben demasiadas peticiones de un usuario dentro del periodo de tiempo declarado, dever\u00ed\u00e1 devolverse una respuesta con c\u00f3digo de estado 429 (que significa \"Demasiadas peticiones\")."},"47":{"u":".\/\/guide-structure-application-components.html","t":"Componentes de la Aplicaci\u00f3n ","d":"Las aplicaciones son service locators (localizadores de servicios). Ellas albergan\nun grupo de los llamados componentes de aplicaci\u00f3n que proveen diferentes servicios para procesar el request (petici\u00f3n).\nPor ejemplo, el componente urlManager es responsable por rutear Web requests (peticiones) a los controladores apropiados;\nel componente db provee servicios relacionados a base de datos; y as\u00ed sucesivamente."},"48":{"u":".\/\/guide-start-forms.html","t":"Trabajando con Formularios ","d":"En esta secci\u00f3n, describiremos como crear una nueva p\u00e1gina para solicitar informaci\u00f3n de los usuarios.\nLa p\u00e1gina mostrar\u00e1 un formulario con un campo de input para el nombre y un campo de input para el email.\nDespu\u00e9s de recibir estos datos del usuario, la p\u00e1gina le mostrar\u00e1 la informaci\u00f3n de vuelta al usuario para la confirmaci\u00f3n."},"49":{"u":".\/\/guide-security-overview.html","t":"Security ","d":"Good security is vital to the health and success of any application. Unfortunately, many developers cut corners when it\ncomes to security, either due to a lack of understanding or because implementation is too much of a hurdle. To make your\nYii powered application as secure as possible, Yii has included several excellent and easy to use security features."},"50":{"u":".\/\/guide-structure-filters.html","t":"Filtros ","d":"Los Filtros (filters) son objetos que se ejecutan antes y\/o despu\u00e9s de las \nacciones de controlador. Por ejemplo, un filtro de control de acceso puede \nejecutarse antes de las acciones para asegurar que un usuario final tiene permitido acceder a estas; un filtro de \ncompresi\u00f3n de contenido puede ejecutarse despu\u00e9s de las acciones para comprimir el contenido de la respuesta antes de \nser enviado al usuario final."},"51":{"u":".\/\/guide-caching-http.html","t":"Cach\u00e9 HTTP ","d":"Adem\u00e1s del almacenamiento de cach\u00e9 en el servidor que hemos descrito en secciones anteriores, las aplicaciones Web\npueden hacer uso de la cach\u00e9 en el lado del cliente para as\u00ed ahorrar tiempo y recursos para generar y transmitir el\nmismo contenido una y otra vez."},"52":{"u":".\/\/guide-structure-models.html","t":"Modelos ","d":"Los modelos forman parte de la arquitectura \nMVC. Son objetos que representan datos de \nnegocio, reglas y l\u00f3gica."},"53":{"u":".\/\/guide-concept-di-container.html","t":"Contenedor de Inyecci\u00f3n de Dependencias ","d":"Un contenedor de Inyecci\u00f3n de Dependencias (ID), es un objeto que sabe como instancias y configurar objetos y sus \nobjetos dependientes. El articulo de Martin contiene una buena \nexplicaci\u00f3n de porque son \u00fatiles los contenedores de ID. A continuaci\u00f3n explicaremos como usar el contenedor de ID que \nproporciona Yii."},"54":{"u":".\/\/guide-runtime-routing.html","t":"Enrutamiento y Creaci\u00f3n de URLS ","d":"Cuando una aplicaci\u00f3n Yii empieza a procesar una URL solicitada, lo primero que hace es convertir la URL en una \nruta. Luego se usa la ruta para instanciar la \nacci\u00f3n de controlador correspondiente para gestionar la petici\u00f3n. A este proceso se \nle llama enrutamiento."},"55":{"u":".\/\/guide-output-data-widgets.html","t":"Data widgets ","d":"Yii provides a set of widgets that can be used to display data.\nWhile the DetailView widget can be used to display data for a single record,\nListView and GridView can be used to display a list or table of data records\nproviding features like pagination, sorting and filtering."},"56":{"u":".\/\/guide-output-sorting.html","t":"Sorting ","d":"When displaying multiple rows of data, it is often needed that the data be sorted according to some columns\nspecified by end users. Yii uses a yii\\data\\Sort object to represent the information about a sorting schema.\nIn particular, "},"57":{"u":".\/\/guide-helper-url.html","t":"Clase Auxiliar URL (URL Helper) ","d":"La clase auxiliar URL proporciona un conjunto de m\u00e9todos est\u00e1ticos para gestionar URLs."},"58":{"u":".\/\/guide-helper-overview.html","t":"Helpers ","d":"Note: Esta secci\u00f3n est\u00e1 en desarrollo."},"59":{"u":".\/\/guide-concept-aliases.html","t":"Alias ","d":"Loa alias son utilizados para representar rutas o URLs de manera que no tengas que escribir expl\u00edcitamente rutas absolutas o URLs en tu\nproyecto. Un alias debe comenzar con el signo @ para ser diferenciado de una ruta normal de archivo y de URLs. Los alias definidos\nsin el @ del principio, ser\u00e1n prefijados con el signo @."},"60":{"u":".\/\/guide-caching-overview.html","t":"El Almacenamiento en Cach\u00e9 ","d":"El almacenamiento en cach\u00e9 es una forma econ\u00f3mica y eficaz para mejorar el rendimiento de una aplicaci\u00f3n web. Mediante\nel almacenamiento de datos relativamente est\u00e1ticos en la memoria cach\u00e9 y su correspondiente recuperaci\u00f3n cuando \u00e9stos sean\nsolicidatos, la aplicaci\u00f3n salvar\u00eda todo ese tiempo y recursos necesarios para volver a generarlos cada vez desde cero."},"61":{"u":".\/\/guide-concept-configurations.html","t":"Configuraci\u00f3n ","d":"Las configuraciones se utilizan ampliamente en Yii al crear nuevos objetos o inicializar los objetos existentes. Las configuraciones por lo general incluyen el nombre de la clase del objeto que se est\u00e1 creando, y una lista de los valores iniciales que deber\u00edan ser asignadas a las del propiedades objeto. Las configuraciones tambi\u00e9n pueden incluir una lista de manipuladores que deban imponerse a del objeto eventos y\/o una lista de comportamientos que tambi\u00e9n ha de atribuirse al objeto."},"62":{"u":".\/\/guide-structure-extensions.html","t":"Extensiones ","d":"Las extensiones son paquetes de software redistribuibles dise\u00f1ados especialmente para ser usados en aplicaciones Yii y\nproporcionar caracter\u00edsticas listas para ser usadas. Por ejemplo, la extensi\u00f3n yiisoft\/yii2-debug\na\u00f1ade una practica barra de herramientas de depuraci\u00f3n (debug toolbar) al final de cada p\u00e1gina de la aplicaci\u00f3n para\nayudar a comprender m\u00e1s f\u00e1cilmente como se han generado las p\u00e1ginas. Se pueden usar extensiones para acelerar el\nproceso de desarrollo. Tambi\u00e9n se puede empaquetar c\u00f3digo propio para compartir nuestro trabajo con otra gente."},"63":{"u":".\/\/guide-start-workflow.html","t":"Corriendo Aplicaciones ","d":"Despu\u00e9s de haber instalado Yii, tienes una aplicaci\u00f3n totalmente funcional a la que se puede acceder a trav\u00e9s de\nla URL http:\/\/hostname\/basic\/web\/index.php o http:\/\/hostname\/index.php, dependiendo de tu configuraci\u00f3n.\nEsta secci\u00f3n ser\u00e1 una introducci\u00f3n a la funcionalidad incluida de la aplicaci\u00f3n, c\u00f3mo se organiza el c\u00f3digo,\ny c\u00f3mo la aplicaci\u00f3n maneja los requests en general."},"64":{"u":".\/\/guide-glossary.html","t":"A ","d":"Alias es un string utilizado por Yii para referirse a una clase o directorio tal como @app\/vendor."},"65":{"u":".\/\/guide-output-formatting.html","t":"Data Formatting ","d":"To display data in a more readable format for users, you may format them using the formatter application component.\nBy default the formatter is implemented by yii\\i18n\\Formatter which provides a set of methods to format data as \ndate\/time, numbers, currencies, and other commonly used formats. You can use the formatter like the following,"},"66":{"u":".\/\/guide-structure-overview.html","t":"Informaci\u00f3n general ","d":"Las aplicaciones realizadas con Yii est\u00e1n organizadas de acuerdo al patr\u00f3n de dise\u00f1o modelo-vista-controlador (MVC). Los\nmodelos representan datos, la l\u00f3gica de negocios y sus reglas; las vistas \nson la representaci\u00f3n de salida de los modelos; y finalmente, los controladores que toman datos de entrada y los convierten en instrucciones para los modelos y vistas. "},"67":{"u":".\/\/guide-test-unit.html","t":"Tests de Unidad  ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"68":{"u":".\/\/guide-db-query-builder.html","t":"Constructor de Consultas ","d":"Note: Esta secci\u00f3n est\u00e1 en desarrollo."},"69":{"u":".\/\/guide-rest-resources.html","t":"Recursos ","d":"Las APIs RESTful lo son todos para acceder y manipular recursos (resources). Puedes observar los recursos en el paradigma MVC en Modelos (models) ."},"70":{"u":".\/\/guide-tutorial-performance-tuning.html","t":"Performance Tuning ","d":"There are many factors affecting the performance of your Web application. Some are environmental, some are related \nwith your code, while some others are related with Yii itself. In this section, we will enumerate most of these\nfactors and explain how you can improve your application performance by adjusting these factors."},"71":{"u":".\/\/guide-concept-properties.html","t":"Propiedades ","d":"En PHP, las variables miembro de clases tambi\u00e9n llamadas propiedades, son parte de la definici\u00f3n de la clase, y se\nusan para representar el estado de una instancia de la clase (ej. para diferenciar una instancia de clase de otra).\nA la pr\u00e1ctica, a menudo, se puede querer gestionar la lectura o escritura de las propiedades de algunos momentos. Por\nejemplo, se puede querer eliminar los espacios en blanco (trim) de una cadena de texto cada vez que esta se asigne a\nuna propiedad de tipo label. Se podr\u00eda usar el siguiente c\u00f3digo para realizar esta tarea:"},"72":{"u":".\/\/guide-security-passwords.html","t":"Trabajar con Passwords ","d":"La mayor\u00eda de los desarrolladores saben que los passwords no deben ser guardados en texto plano, pero muchos desarrolladores a\u00fan creen\nque es seguro aplicar a los passowrds hash md5 o sha1. Hubo un tiempo cuando utilizar esos algoritmos de hash mencionados era suficiente,\npero el hardware moderno hace posible que ese tipo de hash e incluso m\u00e1s fuertes, puedan revertirse r\u00e1pidamente utilizando ataques de fuerza bruta."},"73":{"u":".\/\/guide-caching-page.html","t":"Cach\u00e9 de P\u00e1ginas ","d":"La cach\u00e9 de p\u00e1ginas se refiere a guardar el contenido de toda una p\u00e1gina en el almacenamiento de cach\u00e9 del servidor.\nPosteriormente, cuando la misma p\u00e1gina sea requerida de nuevo, su contenido ser\u00e1 devuelto desde la cach\u00e9 en vez de\nvolver a generarlo desde cero."},"74":{"u":".\/\/guide-tutorial-mailing.html","t":"Env\u00edo de Emails ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"75":{"u":".\/\/guide-security-best-practices.html","t":"Security best practices ","d":"Below we'll review common security principles and describe how to avoid threats when developing applications using Yii.\nMost of these priciples are not unique to Yii alone but apply to website or software development in general,\nso we you will also find links for further reading on the general ideas behind these."},"76":{"u":".\/\/guide-runtime-logging.html","t":"Registro de anotaciones ","d":"Yii proporciona un poderoso framework dedicado al registro de anotaciones (logging) que es altamente personalizable y\nextensible. Usando este framework se pueden guardar f\u00e1cilmente anotaciones (logs) de varios tipos de mensajes,\nfiltrarlos, y unificarlos en diferentes destinos que pueden ser archivos, bases de datos o emails."},"77":{"u":".\/\/guide-db-dao.html","t":"Objetos de Acceso a Bases de Datos ","d":"Construido sobre PDO, Yii DAO (Objetos de Acceso a Bases de Datos) proporciona una\nAPI orientada a objetos para el acceso a bases de datos relacionales. Es el fundamento para otros m\u00e9todos de acceso a bases de datos\nm\u00e1s avanzados, incluyendo el constructor de consultas y active record."},"78":{"u":".\/\/guide-start-gii.html","t":"Generando C\u00f3digo con Gii ","d":"En esta secci\u00f3n, explicaremos c\u00f3mo utilizar Gii para generar c\u00f3digo que autom\u00e1ticamente\nimplementa algunas de las caracter\u00edsticas m\u00e1s comunes de una aplicaci\u00f3n. Para lograrlo, todo lo que tienes que hacer es\ningresar la informaci\u00f3n de acuerdo a las instrucciones mostradas en la p\u00e1ginas web de Gii."},"79":{"u":".\/\/guide-output-theming.html","t":"Temas ","d":"Note: Esta secci\u00f3n est\u00e1 en desarrollo."},"80":{"u":".\/\/guide-test-functional.html","t":"Tests Funcionales ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"81":{"u":".\/\/guide-runtime-handling-errors.html","t":"Gesti\u00f3n de Errores ","d":"Yii incluye un yii\\web\\ErrorHandler que permite una gesti\u00f3n de errores mucho m\u00e1s pr\u00e1ctica que\nanteriormente. En particular, el gestor de errores de Yii hace lo siguiente para mejorar la gesti\u00f3n de errores:"},"82":{"u":".\/\/guide-structure-widgets.html","t":"Widgets ","d":"Los Widgets son bloques de c\u00f3digo reutilizables utilizados en las vistas para crear elementos de \ninterfaz de usuario complejos y configurables de forma orientada a objetos. Por ejemplo, widget DatePicker puede \ngenerar un DatePicker de lujo que permita a los usuarios seleccionar una fecha. Todo lo que se tiene que hacer es \ninsertar el siguiente c\u00f3digo en una vista."},"83":{"u":".\/\/guide-rest-versioning.html","t":"Versionado ","d":"Una buena API ha de ser versionada: los cambios y las nuevas caracter\u00edsticas son implementadas en las nuevas versiones del API, en vez de estar continuamente modificando s\u00f3lo una versi\u00f3n. Al contrario que en las aplicaciones Web, en las cuales tienes total control del c\u00f3digo de ambas partes lado del cliente y lado del servidor,\nlas APIs est\u00e1n destinadas a ser usadas por los clientes fuera de tu control. Por esta raz\u00f3n, compatibilidad hacia atr\u00e1s (BC Backward compatibility)\nde las APIs ha de ser mantenida siempre que sea posible. Si es necesario un cambio que puede romper la BC, debes de introducirla en la nueva versi\u00f3n del API, e incrementar el n\u00famero de versi\u00f3n. Los clientes que la usan pueden continuar usando la antigua versi\u00f3n de trabajo del API; los nuevos y actualizados clientes pueden obtener la nueva funcionalidad de la nueva versi\u00f3n del API."},"84":{"u":".\/\/guide-output-data-providers.html","t":"Data Providers ","d":"In the Pagination and Sorting sections, we have described how to\nallow end users to choose a particular page of data to display and sort them by some columns. Because the task\nof paginating and sorting data is very common, Yii provides a set of data provider classes to encapsulate it."},"85":{"u":".\/\/guide-input-tabular-input.html","t":"Collecting tabular input ","d":"Sometimes you need to handle multiple models of the same kind in a single form. For example, multiple settings, where\neach setting is stored as a name-value pair and is represented by a Setting active record model.\nThis kind of form is also often referred to as \"tabular input\".\nIn contrast to this, handling different models of different kind, is handled in the section\nComplex Forms with Multiple Models."},"86":{"u":".\/\/guide-caching-fragment.html","t":"Cach\u00e9 de Fragmentos ","d":"La Cach\u00e9 de Fragmentos se refiere al almacenamiento en cach\u00e9 de un fragmento, o secci\u00f3n, de una p\u00e1gina Web. Por ejemplo, si\nuna p\u00e1gina muestra un sumario de las ventas anuales en una tabla, podr\u00edas guardar esta tabla en memoria cach\u00e9 para\neliminar el tiempo necesario para generar esta tabla en cada petici\u00f3n (request). La cach\u00e9 de fragmentos est\u00e1 construido\nsobre la cach\u00e9 de datos."},"87":{"u":".\/\/guide-structure-applications.html","t":"Aplicaciones ","d":"Las Applications (aplicaciones) son objetos que gobiernan la estructura total y el ciclo de vida de las aplicaciones\nhechas en Yii.\nCada aplicaci\u00f3n Yii contiene un objeto Application que es creado en el script de entrada\ny es globalmente accesible a trav\u00e9s de la expresi\u00f3n \\Yii::$app."},"88":{"u":".\/\/guide-tutorial-start-from-scratch.html","t":"Crear tu propia estructura de Aplicaci\u00f3n ","d":"Note: Esta secci\u00f3n se encuentra en desarrollo."},"89":{"u":".\/\/guide-input-multiple-models.html","t":"Obtenci\u00f3n de datos para los modelos de m\u00faltiples ","d":"Cuando se trata de algunos datos complejos, es posible que puede que tenga que utilizar varios modelos diferentes para recopilar\nla entrada del usuario. Por ejemplo, suponiendo que la informaci\u00f3n de inicio de sesi\u00f3n del usuario se almacena en la tabla user, \nmientras que el perfil de usuario la informaci\u00f3n se almacena en la tabla Profile, es posible que desee para recoger los datos\nde entrada sobre un usuario a trav\u00e9s de un modelo User y un modelo Profile. Con el modelo de Yii y apoyo formulario, \npuede solucionar este problema de una manera que no es mucho diferente de la manipulaci\u00f3n de un solo modelo."},"90":{"u":".\/\/guide-tutorial-console.html","t":"Console applications ","d":"Besides the rich features for building web applications, Yii also has full-featured support for console applications\nwhich are mainly used to create background and maintenance tasks that need to be performed for a website."},"91":{"u":".\/\/guide-helper-array.html","t":"ArrayHelper ","d":"Adicionalmente al rico conjunto de funciones para arrays de PHP, el array helper de Yii proporciona\nm\u00e9todos est\u00e1ticos adicionales permitiendo trabajar con arrays de manera m\u00e1s eficiente."},"92":{"u":".\/\/guide-runtime-bootstrapping.html","t":"Bootstrapping ","d":"El Bootstrapping hace referencia al proceso de preparar el entorno antes de que una aplicaci\u00f3n se inicie para resolver y procesar una petici\u00f3n entrante. El se ejecuta en dos lugares: el script de entrada y la aplicaci\u00f3n."},"93":{"u":".\/\/guide-structure-modules.html","t":"M\u00f3dulos ","d":"Los m\u00f3dulos son unidades de software independientes que consisten en modelos, \nvistas, controladores, y otros componentes de apoyo. Los usuarios \nfinales pueden acceder a los controladores de un m\u00f3dulo cuando \u00e9ste est\u00e1 instalado en la \naplicaci\u00f3n. Por \u00e9stas razones, los m\u00f3dulos a menudo se considerados como \nmini-aplicaciones. Los m\u00f3dulos difieren de las aplicaciones en que los m\u00f3dulos no pueden \nser desplegados solos y tienen que residir dentro de aplicaciones."},"94":{"u":".\/\/guide-concept-events.html","t":"Eventos ","d":"Los eventos permiten inyectar c\u00f3digo dentro de otro c\u00f3digo existente en ciertos puntos de ejecuci\u00f3n. Se pueden adjuntar\nc\u00f3digo personalizado a un evento, cuando se lance (triggered), el c\u00f3digo se ejecutar\u00e1 autom\u00e1ticamente. Por ejemplo, un\nobjeto mailer puede lanzar el evento messageSent cuando se env\u00eda un mensaje correctamente. Si se quiere rastrear\nel correcto env\u00edo del mensaje, se puede, simplemente, a\u00f1adir un c\u00f3digo de seguimiento al evento messageSent."},"95":{"u":".\/\/guide-helper-html.html","t":"Clase auxiliar Html (Html helper) ","d":"Todas las aplicaciones web generan grandes cantidades de marcado HTML (HTML markup). Si el marcado es est\u00e1tico, se\npuede realizar de forma efectiva\nmezclando PHP y HTML en un mismo archivo pero cuando se\ngeneran din\u00e1micamente empieza a complicarse su gesti\u00f3n sin ayuda extra. Yii ofrece esta ayuda en forma de una clase auxiliar Html\nque proporciona un conjunto de m\u00e9todos est\u00e1ticos para gestionar las etiquetas HTML m\u00e1s com\u00fanmente usadas, sus opciones y contenidos."}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			for (w in stopWords) {
				if (stopWords[w] == val) return false;
			}
			return true;
		}).map(function(word) {
			return {t: word, w: 1};
		});
};